package com.highstreets.user.models;import com.google.gson.annotations.Expose;import com.google.gson.annotations.SerializedName;public class ReviewGet {    @SerializedName("id")    @Expose    private String id;    @SerializedName("section")    @Expose    private String section;    @SerializedName("user_id")    @Expose    private String userId;    @SerializedName("merchant_id")    @Expose    private String merchantId;    @SerializedName("offer_id")    @Expose    private String offerId;    @SerializedName("name")    @Expose    private String name;    @SerializedName("review")    @Expose    private String review;    @SerializedName("rating")    @Expose    private String rating;    @SerializedName("created_date")    @Expose    private String createdDate;    @SerializedName("updated_date")    @Expose    private String updatedDate;    @SerializedName("status")    @Expose    private String status;    @SerializedName("ip")    @Expose    private String ip;    public String getId() {        return id;    }    public void setId(String id) {        this.id = id;    }    public String getSection() {        return section;    }    public void setSection(String section) {        this.section = section;    }    public String getUserId() {        return userId;    }    public void setUserId(String userId) {        this.userId = userId;    }    public String getMerchantId() {        return merchantId;    }    public void setMerchantId(String merchantId) {        this.merchantId = merchantId;    }    public String getOfferId() {        return offerId;    }    public void setOfferId(String offerId) {        this.offerId = offerId;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getReview() {        return review;    }    public void setReview(String review) {        this.review = review;    }    public String getRating() {        return rating;    }    public void setRating(String rating) {        this.rating = rating;    }    public String getCreatedDate() {        return createdDate;    }    public void setCreatedDate(String createdDate) {        this.createdDate = createdDate;    }    public String getUpdatedDate() {        return updatedDate;    }    public void setUpdatedDate(String updatedDate) {        this.updatedDate = updatedDate;    }    public String getStatus() {        return status;    }    public void setStatus(String status) {        this.status = status;    }    public String getIp() {        return ip;    }    public void setIp(String ip) {        this.ip = ip;    }}